    "title": "Fistula Foundation - Halima was forced to leave her home in Somaliland and became an \"internally displaced person” (IDP). She still lives within the borders of Somaliland, so she’s not quite a refugee. Yet she resides in an IDP settlement, and the international community declines to recognize her homeland as an independent state. In effect, she is a woman without a country. She's also a single mother with several children. During her most recent pregnancy, Halima gave birth at home, with only a traditional birth attendant by her side. After she experienced an obstructed labor, her child died and she developed fistula. Halima was divorced at the time, and life as a single mother was challenging. She didn’t have the means to see a doctor. She was also ashamed of her constant leaking. Halima felt constant pain and could barely walk. She grew weak and lethargic. Doing household chores was unbearable, and working to support her family was impossible. When she found out that free fistula treatment was available at our partner National Borama Fistula Hospital, she was overjoyed. Halima’s surgery was successful, and today she is dry. She is excited to have her strength back, and vows to tell her story so that women like her will seek treatment. ➡️ So many women in Somaliland are suffering from the same condition that afflicted Halima. You are the key to unlocking a future free from fistula. Gifts MATCHED: https://fistu.la/3Lzr7y4 | Facebook",
